                <img
                    alt=""
                    src={imageUrl}
                    width="500px"
                    height="auto"
                    id="inputimage"
                />
                <div
                    className="bounding-box"
                    style={{
                        top: bo.topRow,
                        right: box.rightCol,
                        bottom: box.bottomRow,
                        left: box.leftCol,
                    }}
                >
                </div>
            </div>
        </div>
    )
}

